","keccak256":"0x562431546443640c950a15ccce0cffedeced3e414c41cc2758bf489f4525d1df","license":"GPL-2.0"},"contracts/core/YieldManager.sol":{"content":"// SPDX-License-Identifier: GPL-2.0
pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/IERC20MetadataUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/utils/SafeERC20Upgradeable.sol";
//import "../interfaces/IBiosRewards.sol";
import "../interfaces/IBiosEmitter.sol";
import "../interfaces/IIntegrationMap.sol";
import "../interfaces/IIntegration.sol";
import "../interfaces/IAMMIntegration.sol";
import "../interfaces/IEtherRewards.sol";
import "../interfaces/IYieldManager.sol";
import "../interfaces/IUserPositions.sol";
import "../interfaces/IWeth9.sol";
import "../interfaces/IStrategyMap.sol";
import "../interfaces/ISyntheticERC20.sol";
import "../interfaces/ISyntheticMap.sol";
import "../interfaces/IStrategy1155.sol";
import "../interfaces/IUnwrapper.sol";
import "../interfaces/ISwapManager.sol";

import "./Controlled.sol";
import "./ModuleMapConsumer.sol";

/// @title Yield Manager
/// @notice Manages yield deployments, harvesting, processing, and distribution
contract YieldManager is Initializable, ModuleMapConsumer, Controlled, IYieldManager {
    using SafeERC20Upgradeable for IERC20MetadataUpgradeable;

    // constants
    uint256 private constant FTM_CHAIN_ID = 250;
    uint256 private constant BSC_CHAIN_ID = 56;
    uint256 private constant METIS_CHAIN_ID = 1088;

    uint256 private gasAccountTargetEthBalance;
    uint32 private biosBuyBackEthWeight;
    uint32 private treasuryEthWeight;
    uint32 private protocolFeeEthWeight;
    uint32 private rewardsEthWeight;
    uint32 private syntheticPoolSupplementEthWeight;
    uint256 private lastEthRewardsAmount;

    address payable private gasAccount;
    address payable private treasuryAccount;

    mapping(address => uint256) private processedWethByToken;
    mapping(address => uint256) private lastHarvestTimestampByIntegration;

    // strategyId => StrategyInfo
    mapping(uint256 => StrategyInfo) private strategies;

    uint256 driftingSynthetic;

    // temporary mapping used in deploy function, content will be cleaned in the end of the function
    mapping(address => DeployRAM) hedged;

    struct DeployRAM {
        uint248 hedgeAmount;
        uint8 tokenFlag;
    }

    event HarvestYield(uint256 strategyId, address[] integration, uint256 amount);

    receive() external payable {}

    /// @param controllers_ The addresses of the controlling contracts
    /// @param moduleMap_ Address of the Module Map
    /// @param gasAccountTargetEthBalance_ The target ETH balance of the gas account
    /// @param biosBuyBackEthWeight_ The relative weight of ETH to send to BIOS buy back
    /// @param treasuryEthWeight_ The relative weight of ETH to send to the treasury
    /// @param protocolFeeEthWeight_ The relative weight of ETH to send to protocol fee accrual
    /// @param rewardsEthWeight_ The relative weight of ETH to send to user rewards
    /// @param gasAccount_ The address of the account to send ETH to gas for executing bulk system functions
    /// @param treasuryAccount_ The address of the system treasury account
    function initialize(
        address[] memory controllers_,
        address moduleMap_,
        uint256 gasAccountTargetEthBalance_,
        uint32 biosBuyBackEthWeight_,
        uint32 treasuryEthWeight_,
        uint32 protocolFeeEthWeight_,
        uint32 rewardsEthWeight_,
        address payable gasAccount_,
        address payable treasuryAccount_
    ) external initializer {
        require(gasAccount_ != address(0), "bad address");
        require(treasuryAccount_ != address(0), "bad address");

        __Controlled_init(controllers_, moduleMap_);
        gasAccountTargetEthBalance = gasAccountTargetEthBalance_;
        biosBuyBackEthWeight = biosBuyBackEthWeight_;
        treasuryEthWeight = treasuryEthWeight_;
        protocolFeeEthWeight = protocolFeeEthWeight_;
        rewardsEthWeight = rewardsEthWeight_;
        gasAccount = gasAccount_;
        treasuryAccount = treasuryAccount_;
    }

    /// @param gasAccountTargetEthBalance_ The target ETH balance of the gas account
    function updateGasAccountTargetEthBalance(uint256 gasAccountTargetEthBalance_) external override onlyController {
        gasAccountTargetEthBalance = gasAccountTargetEthBalance_;
    }

    /// @param biosBuyBackEthWeight_ The relative weight of ETH to send to BIOS buy back
    /// @param treasuryEthWeight_ The relative weight of ETH to send to the treasury
    /// @param protocolFeeEthWeight_ The relative weight of ETH to send to protocol fee accrual
    /// @param rewardsEthWeight_ The relative weight of ETH to send to user rewards
    /// @param syntheticPoolSupplement_ The relative weight of ETH to send to synthetic pool on curve
    function updateEthDistributionWeights(
        uint32 biosBuyBackEthWeight_,
        uint32 treasuryEthWeight_,
        uint32 protocolFeeEthWeight_,
        uint32 rewardsEthWeight_,
        uint32 syntheticPoolSupplement_
    ) external override onlyController {
        biosBuyBackEthWeight = biosBuyBackEthWeight_;
        treasuryEthWeight = treasuryEthWeight_;
        protocolFeeEthWeight = protocolFeeEthWeight_;
        rewardsEthWeight = rewardsEthWeight_;
        syntheticPoolSupplementEthWeight = syntheticPoolSupplement_;
    }

    /// @param gasAccount_ The address of the account to send ETH to gas for executing bulk system functions
    function updateGasAccount(address payable gasAccount_) external override onlyController {
        require(gasAccount_ != address(0), "bad address");
        gasAccount = gasAccount_;
    }

    /// @param treasuryAccount_ The address of the system treasury account
    function updateTreasuryAccount(address payable treasuryAccount_) external override onlyController {
        require(treasuryAccount_ != address(0), "bad address");
        treasuryAccount = treasuryAccount_;
    }

    /**
     *
     *
     * Deploy
     *
     *
     **/

    /// @notice Deploys all tokens to all integrations according to configured weights and also sends hedge amount to specified pool
    function deploy(DeployRequest[] calldata deployments) external override onlyController {
        IStrategyMap strategyMap = IStrategyMap(moduleMap.getModuleAddress(Modules.StrategyMap));
        address kernel = moduleMap.getModuleAddress(Modules.Kernel);

        uint256 totalWithdrawn;
        uint256 totalDeposited;

        for (uint256 dpmt; dpmt < deployments.length; dpmt++) {
            require(_checkNumberOfTokens(deployments[dpmt]), "too many tokens");

            (uint256 sWithdrawn, uint256 sDeposited, address underlying, uint256 sHedged) = _performSingleDeploy(
                strategyMap,
                deployments[dpmt],
                kernel
            );

            totalWithdrawn += sWithdrawn;
            totalDeposited += sDeposited;
            hedged[underlying].hedgeAmount += uint248(sHedged);
            if (hedged[underlying].tokenFlag == 0) hedged[underlying].tokenFlag = 1;
        }

        for (uint256 dpmt; dpmt < deployments.length; dpmt++) {
            address underlying = deployments[dpmt].tokens[0];

            if (hedged[underlying].tokenFlag == 1) {
                address syntheticERC20 = ISyntheticMap(moduleMap.getModuleAddress(Modules.SyntheticMap))
                    .underlyingToSynthetic(underlying);

                (address hedgeIntegration, uint32 ammPoolID, address syntheticToken) = ISyntheticERC20(syntheticERC20)
                    .getHedgeDeployArgs();

                uint256 positiveDeploy = totalDeposited + uint256(hedged[underlying].hedgeAmount);
                if (positiveDeploy > 0) {
                    // We mint synthetic tokens equal to the total positive deploy amount to the kernel
                    // because we will futher use this synthetic assets to execute user withdraw:
                    // 1) Withdraw from synETH/ETH pool until specified ratio
                    // 2) Close positions in integrations and burn synthetic token
                    _mintSyntheticToKernel(syntheticToken, kernel, positiveDeploy);
                }

                _redeemSynthetic(
                    totalWithdrawn,
                    ISyntheticERC20(syntheticToken),
                    underlying,
                    kernel,
                    hedgeIntegration,
                    ammPoolID
                );

                // Send funds to synETH/ETH pool if hedge percent > 0
                if (hedged[underlying].hedgeAmount > 0) {
                    _depositToSyntheticPool(
                        kernel,
                        syntheticToken,
                        underlying,
                        hedgeIntegration,
                        ammPoolID,
                        uint256(hedged[underlying].hedgeAmount)
                    );

                    delete hedged[underlying];
                }
            }
        }
    }

    /**
     *
     *
     * Deploy parts
     *
     *
     **/

    function _checkNumberOfTokens(DeployRequest memory deployment) private view returns (bool isCorrect_) {
        if (deployment.ammPoolID > 0 && deployment.tokens.length > 2) {
            IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
            string memory integrationName = integrationMap.getIntegrationName(deployment.integration);

            if (deployment.tokens.length > 4 || !compareStrings(integrationName, "Curve Finance")) {
                return false;
            }

            return true;
        }
        return true;
    }

    function _performSingleDeploy(
        IStrategyMap _strategyMap,
        DeployRequest memory _deployment,
        address _kernel
    )
        private
        returns (
            uint256 withdrawn_,
            uint256 deposited_,
            address underlying_,
            uint256 hedged_
        )
    {
        for (uint256 tkn; tkn < _deployment.tokens.length; tkn++) {
            (int256 deployAmount, uint256 hedgeAmount) = _strategyMap.getDeployAmount(
                _deployment.integration,
                _deployment.ammPoolID,
                _deployment.tokens[tkn]
            );

            if (deployAmount > 0) {
                hedged_ += hedgeAmount;
                deposited_ += abs(deployAmount);

                IERC20MetadataUpgradeable(_deployment.tokens[tkn]).safeTransferFrom(
                    _kernel,
                    _deployment.integration,
                    abs(deployAmount)
                );
                _depositToIntegration(
                    _deployment.integration,
                    _deployment.tokens[tkn],
                    _deployment.ammPoolID,
                    abs(deployAmount)
                );
            } else if (deployAmount < 0) {
                withdrawn_ += _withdrawFromIntegration(
                    _deployment.integration,
                    _deployment.tokens[tkn],
                    _deployment.ammPoolID,
                    abs(deployAmount),
                    _kernel
                );
            }

            if (deployAmount != 0) {
                _strategyMap.decreaseDeployAmountChange(
                    _deployment.integration,
                    _deployment.ammPoolID,
                    _deployment.tokens[tkn],
                    abs(deployAmount),
                    hedgeAmount
                );
            }
        }

        underlying_ = _deployment.tokens[0];
    }

    function _depositToIntegration(
        address _integration,
        address _token,
        uint32 _ammPoolId,
        uint256 _amount
    ) private {
        if (_ammPoolId > 0) {
            IAMMIntegration integration = IAMMIntegration(_integration);
            integration.deposit(_token, _amount, _ammPoolId);
            integration.deploy(_ammPoolId);
        } else {
            IIntegration integration = IIntegration(_integration);
            integration.deposit(_token, _amount);
            integration.deploy();
        }
    }

    function _withdrawFromIntegration(
        address _integration,
        address _token,
        uint32 _ammPoolId,
        uint256 _deployAmount,
        address _kernel
    ) private returns (uint256 withdrawn_) {
        uint256 balanceBefore = IERC20MetadataUpgradeable(_token).balanceOf(_kernel);
        if (_ammPoolId > 0) {
            IAMMIntegration(_integration).withdraw(_token, _deployAmount, _ammPoolId);
        } else {
            IIntegration(_integration).withdraw(_token, _deployAmount);
        }
        withdrawn_ = IERC20MetadataUpgradeable(_token).balanceOf(_kernel) - balanceBefore;
    }

    function _mintSyntheticToKernel(
        address _syntheticToken,
        address _kernel,
        uint256 _amount
    ) private {
        if (driftingSynthetic > 0) {
            if (driftingSynthetic >= _amount) {
                driftingSynthetic -= _amount;
            } else {
                uint256 missing = _amount - driftingSynthetic;
                delete driftingSynthetic;
                ISyntheticERC20(_syntheticToken).mint(_kernel, missing);
            }
        } else {
            ISyntheticERC20(_syntheticToken).mint(_kernel, _amount);
        }
    }

    function _redeemSynthetic(
        uint256 _withdrawn,
        ISyntheticERC20 _syntheticToken,
        address _underlyingToken,
        address _kernel,
        address _hedgeIntegration,
        uint32 _ammPoolID
    ) private {
        uint256 balanceBefore = _syntheticToken.balanceOf(_kernel);

        (, uint256 toRedemptionOfSynthetic) = _syntheticToken.distributeAccordingToStrategiesDebt(_withdrawn);

        toRedemptionOfSynthetic += _syntheticToken.getAndDeleteDelayedRedemptionOfSynthetic();

        if (toRedemptionOfSynthetic > 0) {
            ISwapManager(moduleMap.getModuleAddress(Modules.SwapManager)).gentleSwapExactIn(
                _underlyingToken,
                address(_syntheticToken),
                2,
                1,
                _kernel,
                toRedemptionOfSynthetic,
                0
            );
        }

        uint256 withdrawSynthetic = _syntheticToken.getAndDeleteStrategiesPoolDebt();

        if (withdrawSynthetic > 0) {
            _withdrawFromSyntheticPool(
                address(_syntheticToken),
                _underlyingToken,
                _hedgeIntegration,
                _ammPoolID,
                withdrawSynthetic,
                0
            );
        }

        driftingSynthetic += _syntheticToken.balanceOf(_kernel) - balanceBefore;
    }

    function donateToSyntheticPool(
        address _kernel,
        address _syntheticToken,
        address _underlyingToken,
        address _integration,
        uint32 _ammPoolID,
        uint256 _amountSynthetic,
        uint256 _amountUnderlying
    ) external onlyOwner {
        require(_amountSynthetic + _amountUnderlying > 0, "donate amount must be > 0");

        IERC20MetadataUpgradeable(_syntheticToken).safeTransferFrom(_kernel, _integration, _amountSynthetic);
        IERC20MetadataUpgradeable(_underlyingToken).safeTransferFrom(_kernel, _integration, _amountUnderlying);

        IAMMIntegration(_integration).deposit(_syntheticToken, _amountSynthetic, _ammPoolID);
        IAMMIntegration(_integration).deposit(_underlyingToken, _amountUnderlying, _ammPoolID);

        IAMMIntegration(_integration).deploy(_ammPoolID);
    }

    function _depositToSyntheticPool(
        address _kernel,
        address _syntheticToken,
        address _underlyingToken,
        address _integration,
        uint32 _ammPoolID,
        uint256 _amount
    ) private {
        (uint256 underlyingLiquidity, uint256 syntheticLiquidity) = ISyntheticERC20(_syntheticToken)
            .adjustLiquidityAccordingToUnderlyingDebt(_amount);

        if (underlyingLiquidity > syntheticLiquidity) {
            // (underlyingLiquidity - syntheticLiquidity) - our underlying debt, kernel will hold it for the next withdrawals
            driftingSynthetic += underlyingLiquidity - syntheticLiquidity;
        }

        IERC20MetadataUpgradeable(_underlyingToken).safeTransferFrom(_kernel, _integration, underlyingLiquidity);
        IERC20MetadataUpgradeable(_syntheticToken).safeTransferFrom(_kernel, _integration, syntheticLiquidity);

        IAMMIntegration(_integration).deposit(_underlyingToken, underlyingLiquidity, _ammPoolID);
        IAMMIntegration(_integration).deposit(_syntheticToken, syntheticLiquidity, _ammPoolID);

        if (underlyingLiquidity + syntheticLiquidity > 0) IAMMIntegration(_integration).deploy(_ammPoolID);
    }

    function _withdrawFromSyntheticPool(
        address _syntheticToken,
        address _underlyingToken,
        address _integration,
        uint32 _ammPoolID,
        uint256 _syntheticAmount,
        uint256 _underlyingAmount
    ) private {
        if (_syntheticAmount > 0) IAMMIntegration(_integration).withdraw(_syntheticToken, _syntheticAmount, _ammPoolID);
        if (_underlyingAmount > 0)
            IAMMIntegration(_integration).withdraw(_underlyingToken, _underlyingAmount, _ammPoolID);
    }

    /**
     *
     *
     * Harvest
     *
     *
     **/

    /// @notice Harvests available yield from provided and integration, credited to strategy
    /// @param strategyId Strategy to credit the yield to
    /// @param integrations The integrations to harvest yield from
    function harvestYield(
        uint256 strategyId,
        address[] calldata integrations,
        uint256 amount,
        bool setAccounting
    ) external override onlyManager {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        address wethAddress = integrationMap.getWethTokenAddress();
        IERC20MetadataUpgradeable weth = IERC20MetadataUpgradeable(wethAddress);

        // Harvest yield and account the weth
        uint256 balanceBefore = weth.balanceOf(address(this));
        for (uint256 i; i < integrations.length; ++i) {
            IIntegration(integrations[i]).harvestYield();
        }

        uint256 receivedWeth = weth.balanceOf(address(this)) - balanceBefore;

        // update accounting
        if (setAccounting) {
            StrategyInfo storage strategy = strategies[strategyId];

            uint256 updateAmount = amount > 0 ? amount : receivedWeth;

            strategy.lastHarvest = block.timestamp;
            strategy.processedWeth += updateAmount;
        }

        emit HarvestYield(strategyId, integrations, receivedWeth);
    }

    /**
     *
     *
     * Distribute
     *
     *
     **/

    /// @notice Distributes ETH to the gas account, BIOS buy back, treasury, protocol fee accrual, and user rewards
    /// @param strategyId An aray of strategy strategyId to distribute eth for
    /// @param positions An array of the total position value for the strategy to prevent flashing
    /// @param biosAmount Amount of bios deposited to prevent flashing
    function distributeEth(
        uint256[] calldata strategyId,
        uint256[] calldata positions,
        uint256 biosAmount
    ) external override onlyController {
        address wethAddress = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress();

        if (biosAmount > 0) {
            // Check against BIOS flashing
            require(
                IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions)).totalStrategyBalance(0) <= biosAmount,
                "YieldManager::expected BIOS exceeded"
            );
        }

        // First fill up gas wallet with ETH
        // We just skip this for now :)
        // If you are going to enable, don't forget to account for where
        // the eth will come from!!
        // uint256 gasAmount = _ethToGasAccount();

        uint256 totalRewards;

        for (uint256 i; i < strategyId.length; ++i) {
            uint256 id = strategyId[i];
            require(id > 0, "YieldManager::invalid strategy");

            // check positions to prevent flasher
            require(
                IStrategyMap(moduleMap.getModuleAddress(Modules.StrategyMap)).getStrategyTokenBalance(
                    id,
                    wethAddress
                ) <= positions[i],
                "YieldManager::position exceeded"
            );

            uint256 wethToDistribute = strategies[id].processedWeth - strategies[id].distributedWeth;

            if (wethToDistribute > 0) {
                (
                    uint256 biosBuyBackWethAmount,
                    uint256 treasuryWethAmount,
                    uint256 protocolFeeWethAmount,
                    uint256 syntheticPoolSupplementAmount,
                    uint256 rewardsWethAmount
                ) = _calculateRewardAmounts(wethToDistribute);

                // Send WETH to SushiSwap trader for BIOS buy back
                if (biosBuyBackWethAmount > 0) {
                    IERC20MetadataUpgradeable(wethAddress).safeTransfer(
                        moduleMap.getModuleAddress(Modules.SwapManager),
                        biosBuyBackWethAmount
                    );
                }

                // Swap WETH for ETH and transfer to the treasury account
                _unwrapWnative(treasuryWethAmount, wethAddress);
                _transferAmount(treasuryWethAmount, treasuryAccount);

                if (protocolFeeWethAmount > 0) {
                    // Send ETH to protocol fee accrual rewards (BIOS stakers)
                    _ethToProtocolFeeAccrual(protocolFeeWethAmount);
                }

                if (syntheticPoolSupplementAmount > 0) {
                    address underlying = IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).idToUnderlying(
                        id
                    );
                    address syntheticERC20 = ISyntheticMap(moduleMap.getModuleAddress(Modules.SyntheticMap))
                        .underlyingToSynthetic(underlying);

                    _ethToSyntheticPool(syntheticPoolSupplementAmount, syntheticERC20, underlying);
                }

                // Send ETH to strategy rewards
                _ethToRewards(id, rewardsWethAmount);
                totalRewards += rewardsWethAmount;

                // Update accounting
                strategies[id].distributedWeth += wethToDistribute;
            }
        }

        // Update stats metric
        lastEthRewardsAmount = totalRewards;
    }

    /**
     *
     *
     * Distribute parts
     *
     *
     **/

    /// @notice Distributes WETH to gas wallet
    function _ethToGasAccount() private returns (uint256 ethAmountToGasAccount) {
        address wethAddress = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress();
        uint256 wethBalance = IERC20MetadataUpgradeable(wethAddress).balanceOf(address(this));

        if (wethBalance > 0) {
            uint256 gasAccountActualEthBalance = gasAccount.balance;
            if (gasAccountActualEthBalance < gasAccountTargetEthBalance) {
                // Need to send ETH to gas account
                if (wethBalance < gasAccountTargetEthBalance - gasAccountActualEthBalance) {
                    // Send all of WETH to gas wallet
                    ethAmountToGasAccount = wethBalance;
                } else {
                    // Send portion of WETH to gas wallet
                    ethAmountToGasAccount = gasAccountTargetEthBalance - gasAccountActualEthBalance;
                }
                _unwrapWnative(ethAmountToGasAccount, wethAddress);
                _transferAmount(ethAmountToGasAccount, gasAccount);
            }
        }
    }

    /// @notice Uses any WETH held in the SushiSwap trader to buy back BIOS which is sent to the Kernel
    /// @param ratioX1000 BIOS/WETH ratio for front runner protection
    function biosBuyBack(uint256 ratioX1000) external override onlyController {
        ISwapManager swapManager = ISwapManager(moduleMap.getModuleAddress(Modules.SwapManager));
        if (
            IERC20MetadataUpgradeable(
                IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress()
            ).balanceOf(address(swapManager)) > 0
        ) {
            // Use all ETH sent to the SwapManager trader to buy BIOS
            swapManager.biosBuyBack(ratioX1000);

            address bios_address = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap))
                .getBiosTokenAddress();
            /// Use all BIOS transferred to the Kernel to update bios rewards
            IBiosEmitter(moduleMap.getModuleAddress(Modules.BiosEmitter)).updatePool(bios_address);
        }
    }

    /// @notice Distributes ETH to Rewards per token
    /// @param strategyId The strategy id to distribute the rewards to
    /// @param ethRewardsAmount The amount of ETH rewards to distribute
    function _ethToRewards(uint256 strategyId, uint256 ethRewardsAmount) private {
        if (ethRewardsAmount > 0) {
            // Distribute eth rewards
            IEtherRewards(moduleMap.getModuleAddress(Modules.EtherRewards)).increaseEthRewards(
                strategyId,
                ethRewardsAmount
            );

            // Convert to eth and send
            _unwrapWnative(
                ethRewardsAmount,
                IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getWethTokenAddress()
            );
            _transferAmount(ethRewardsAmount, moduleMap.getModuleAddress(Modules.Kernel));
        }
    }

    /// @notice Distributes ETH to protocol fee accrual (BIOS staker rewards)
    /// @param protocolFeeEthRewardsAmount Amount of ETH to distribute to protocol fee accrual
    function ethToProtocolFeeAccrual(uint256 protocolFeeEthRewardsAmount) external onlyController {
        _ethToProtocolFeeAccrual(protocolFeeEthRewardsAmount);
    }

    function _ethToProtocolFeeAccrual(uint256 protocolFeeEthRewardsAmount) private {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));

        if (IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions)).totalStrategyBalance(0) > 0) {
            // BIOS has been deposited, increase Ether rewards for BIOS depositors
            IEtherRewards(moduleMap.getModuleAddress(Modules.EtherRewards)).increaseEthRewards(
                0,
                protocolFeeEthRewardsAmount
            );

            _unwrapWnative(protocolFeeEthRewardsAmount, integrationMap.getWethTokenAddress());

            _transferAmount(protocolFeeEthRewardsAmount, moduleMap.getModuleAddress(Modules.Kernel));
        } else {
            // No BIOS has been deposited, send WETH back to Kernel as reserves
            IERC20MetadataUpgradeable(integrationMap.getWethTokenAddress()).transfer(
                moduleMap.getModuleAddress(Modules.Kernel),
                protocolFeeEthRewardsAmount
            );
        }
    }

    function _ethToSyntheticPool(
        uint256 syntheticPoolEthAmount,
        address _synthetic,
        address _underlying
    ) private {
        (address hedgeIntegration, uint32 ammPoolID, ) = ISyntheticERC20(_synthetic).getHedgeDeployArgs();

        IERC20MetadataUpgradeable(_underlying).transfer(hedgeIntegration, syntheticPoolEthAmount);
        IAMMIntegration(hedgeIntegration).deposit(_underlying, syntheticPoolEthAmount, ammPoolID);
        // We will deploy funds in the next deploy call
    }

    function _calculateRewardAmounts(uint256 amount)
        internal
        view
        returns (
            uint256 biosBuyBackAmount,
            uint256 treasuryAmount,
            uint256 protocolFeeAmount,
            uint256 syntheticPoolSupplementAmount,
            uint256 rewardsAmount
        )
    {
        uint256 weightSum = getEthWeightSum();
        biosBuyBackAmount = (amount * biosBuyBackEthWeight) / weightSum;
        treasuryAmount = (amount * treasuryEthWeight) / weightSum;
        protocolFeeAmount = (amount * protocolFeeEthWeight) / weightSum;
        syntheticPoolSupplementAmount = (amount * syntheticPoolSupplementEthWeight) / weightSum;
        rewardsAmount = amount - biosBuyBackAmount - treasuryAmount - protocolFeeAmount - syntheticPoolSupplementAmount;
    }

    /**
     *
     *
     * Getters
     *
     *
     **/

    /// @param tokenAddress The address of the token ERC20 contract
    /// @return The amount of the token held in the Kernel as reserves
    function getReserveTokenBalance(address tokenAddress) public view override returns (uint256) {
        require(
            IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getIsTokenAdded(tokenAddress),
            "YieldManager::getReserveTokenBalance: Token not added"
        );
        return IERC20MetadataUpgradeable(tokenAddress).balanceOf(moduleMap.getModuleAddress(Modules.Kernel));
    }

    /// @return ethWeightSum The sum of ETH distribution weights
    function getEthWeightSum() public view override returns (uint32 ethWeightSum) {
        ethWeightSum =
            biosBuyBackEthWeight +
            treasuryEthWeight +
            protocolFeeEthWeight +
            rewardsEthWeight +
            syntheticPoolSupplementEthWeight;
    }

    /// @return The address of the gas account
    function getGasAccount() public view override returns (address) {
        return gasAccount;
    }

    /// @return The address of the treasury account
    function getTreasuryAccount() public view override returns (address) {
        return treasuryAccount;
    }

    /// @return The last amount of ETH distributed to rewards
    function getLastEthRewardsAmount() public view override returns (uint256) {
        return lastEthRewardsAmount;
    }

    /// @return The target ETH balance of the gas account
    function getGasAccountTargetEthBalance() public view override returns (uint256) {
        return gasAccountTargetEthBalance;
    }

    /// @return The BIOS buyback ETH weight
    /// @return The Treasury ETH weight
    /// @return The Protocol fee ETH weight
    /// @return The rewards ETH weight
    /// @return The synthetic pool ETH supplement weight
    function getEthDistributionWeights()
        public
        view
        override
        returns (
            uint32,
            uint32,
            uint32,
            uint32,
            uint32
        )
    {
        return (
            biosBuyBackEthWeight,
            treasuryEthWeight,
            protocolFeeEthWeight,
            rewardsEthWeight,
            syntheticPoolSupplementEthWeight
        );
    }

    /// @return The timestamp the harvestYield function was last called
    function getLastHarvestYieldTimestamp(address integrationAddress) external view returns (uint256) {
        return lastHarvestTimestampByIntegration[integrationAddress];
    }

    function getStrategyInfo(uint256 strategyId) external view returns (StrategyInfo memory) {
        return strategies[strategyId];
    }

    function getAllPendingYield(address token) external view returns (IntegrationYield[] memory pendingYieldData) {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        uint256 integrationCount = integrationMap.getIntegrationAddressesLength();

        pendingYieldData = new IntegrationYield[](integrationCount);

        for (uint256 integrationId; integrationId < integrationCount; integrationId++) {
            address integrationAddress = integrationMap.getIntegrationAddress(integrationId);
            uint256 pendingYield = IIntegration(integrationAddress).getPendingYield(token);

            pendingYieldData[integrationId] = IntegrationYield(integrationAddress, token, pendingYield);
        }
    }

    /**
     *
     *
     * Help methods
     *
     *
     **/

    function transferClosedPositionsValue(
        address destination,
        address token,
        uint256 amount
    ) external override onlyController {
        require(destination != address(0), "bad address");
        IERC20MetadataUpgradeable(token).safeTransfer(destination, amount);
    }

    function _transferAmount(uint256 amount, address to) internal virtual {
        (bool sent, ) = payable(to).call{value: amount}("");
        require(sent, "Failed to transfer value");
    }

    function _unwrapWnative(uint256 amount, address wnativeAddress) internal virtual returns (bool unwrapped) {
        // just add some ORs on here to check for more chains...
        if (block.chainid == FTM_CHAIN_ID || block.chainid == BSC_CHAIN_ID) {
            // we are on a chain with wnative unwrapping issues

            // get unwrapper address
            address unwrapper = moduleMap.getModuleAddress(Modules.Unwrapper);

            // send wnative to unwrapper and unwrap
            IERC20MetadataUpgradeable(wnativeAddress).safeTransfer(unwrapper, amount);
            IUnwrapper(unwrapper).unwrap(amount);
            return true;
        } else if (block.chainid == METIS_CHAIN_ID) {
            // metis is not wrapped and can already be sent as native token
            return false;
        } else {
            // we are on a chain with working wnative unwrapping, so just do it
            IWeth9(wnativeAddress).withdraw(amount);
            return true;
        }
    }

    function abs(int256 val) internal pure returns (uint256) {
        return uint256(val >= 0 ? val : -val);
    }

    function compareStrings(string memory a, string memory b) public pure returns (bool) {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }
}
